import React, { Component } from "react";

class Footer extends Component {
  render() {
    const { currentYear } = this.props;

    return (
      <footer>
        <p className="copyright">&copy; {currentYear} Kevin Vanantwerpen</p>
      </footer>
    );
  }
}

export default Footer;
